          <div class="col-lg-6 pt-4 pt-lg-0 order-2 order-lg-1 content" data-aos="fade-right">
            <h3>Apa Itu Qr Code</h3>
            <p style="text-align: justify;">
              QR code adalah kode pemindai matriks (matrix barcode) yang terdiri dari pola-pola kotak-kotak hitam dan putih yang dapat dibaca oleh perangkat dengan kamera. QR code dapat menyimpan informasi seperti teks, URL, atau data kontak, dan dapat dengan mudah dibaca dengan menggunakan aplikasi pemindai QR code di perangkat mobile.
            </p>
            <a href="#" class="read-more" data-bs-toggle="modal" data-bs-target="#exampleModal">Read More <i class="bi bi-long-arrow-right"></i></a>
          </div>

          <!-- Modal -->
          <div class="modal fade" id="exampleModal" tabindex="-1" aria-labelledby="exampleModalLabel" aria-hidden="true">
            <div class="modal-dialog modal-lg modal-dialog-centered modal-dialog-scrollable">
              <div class="modal-content">
                <div class="modal-header">
                  <h1 class="modal-title fs-5" id="exampleModalLabel">QR CODE</h1>
                  <button type="button" class="btn-close" data-bs-dismiss="modal" aria-label="Close"></button>
                </div>
                <div class="modal-body">

                  <p>QR code (Quick Response code) adalah kode pemindai matriks (matrix barcode) yang terdiri dari pola-pola kotak-kotak hitam dan putih yang dapat dibaca oleh perangkat dengan kamera. QR code dapat menyimpan informasi seperti teks, URL, atau data kontak, dan dapat dengan mudah dibaca dengan menggunakan aplikasi pemindai QR code di perangkat mobile.</p>
                  <p>QR code pertama kali dikembangkan oleh Toyota untuk mempermudah proses pemasangan suku cadang mobil. Sejak itu, QR code telah digunakan dalam berbagai bidang, seperti pencetakan, logistik, dan retail. QR code juga sering digunakan untuk mempermudah proses pembayaran, mengakses konten digital, dan mengakses informasi produk.</p>
                  <p>Untuk membaca QR code, pengguna hanya perlu mengarahkan kamera perangkat ke QR code, dan aplikasi akan secara otomatis membaca dan menampilkan informasi yang disimpan dalam QR code. QR code sangat berguna karena dapat dengan mudah dibaca oleh perangkat mobile yang sudah dimiliki oleh banyak orang, sehingga proses yang menggunakan QR code menjadi lebih mudah dan efisien.</p>
                  <p>QR code juga terdapat dalam berbagai ukuran dan bentuk, sehingga dapat disesuaikan dengan kebutuhan pengguna. QR code juga dapat diubah-ubah isinya sesuai kebutuhan, sehingga dapat digunakan untuk berbagai macam tujuan.</p>



